import React, { Component } from 'react'

export class SignupClass extends Component {

    state={
        phone:'0122',
        password:'nul',
        consfirmPassword:'',
    }
    onChangeHandler=()=>{
        this.setState({
            name:this.state.value,
        })
    }
    render() {
        return (
            <div>
             <input name="phone" value={this.state.phone} onClick={this.onChangeHandler} />
             <input name="password" value={this.state.phone} onClick={this.onChangeHandler} />
            </div>
        )
    }
}

export default SignupClass
